import React from 'react';

export default function CenteredGrid() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Paper className={classes.paper}><EntryTitle></EntryTitle></Paper>
        </Grid>
        <Grid item xs={12}>
          <Paper className={classes.paper}><EntryContent></EntryContent></Paper>
        </Grid>
        <Grid item xs={12}>
          <Paper className={classes.paper}><Button></Button></Paper>
        </Grid>
      </Grid>
    </div>
  );
}
